import React, { useState } from "react";
import {
  Container,
  TextField,
  Button,
  Typography,
  Snackbar,
  Box,
  Card,
  Fade,
} from "@mui/material";
import api from "../api/axios";
import { useNavigate } from "react-router-dom";

export default function Register() {
  const [form, setForm] = useState({ name: "", email: "", password: "" });
  const [alert, setAlert] = useState(false);
  const navigate = useNavigate();

  const handleSubmit = async (e) => {
    e.preventDefault();
    await api.post("/auth/register", form);
    setAlert(true);
    setTimeout(() => navigate("/login"), 2000);
  };

  return (
    <Fade in={true} timeout={800}>
      <Box
        sx={{
          minHeight: "100vh",
          background: "linear-gradient(135deg, #0a0a0a, #121212, #1e1e1e)",
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          py: 6,
        }}
      >
        <Card
          elevation={8}
          sx={{
            width: "100%",
            maxWidth: 420,
            p: 4,
            borderRadius: 4,
            boxShadow: "0 8px 25px rgba(255, 215, 0, 0.2)",
            background: "rgba(25, 25, 25, 0.9)",
            backdropFilter: "blur(12px)",
            textAlign: "center",
            color: "#fff",
          }}
        >
          <Typography
            variant="h4"
            fontWeight={700}
            mb={3}
            sx={{
              background: "linear-gradient(90deg, #FFD700, #FFA500)",
              WebkitBackgroundClip: "text",
              WebkitTextFillColor: "transparent",
              letterSpacing: "0.8px",
            }}
          >
            Create Your Account
          </Typography>

          <Typography
            variant="body2"
            color="#bbbbbb"
            mb={3}
            sx={{ fontFamily: "Poppins, sans-serif" }}
          >
            Join <strong>Dishcovery</strong> and start sharing your recipes
            today!
          </Typography>

          <form onSubmit={handleSubmit}>
            <TextField
              label="Full Name"
              name="name"
              fullWidth
              required
              margin="normal"
              variant="outlined"
              onChange={(e) => setForm({ ...form, name: e.target.value })}
              InputLabelProps={{ style: { color: "#ccc" } }}
              InputProps={{
                style: { color: "#fff" },
              }}
              sx={{
                "& .MuiOutlinedInput-root": {
                  borderRadius: 2,
                  "& fieldset": {
                    borderColor: "#FFD700",
                  },
                  "&:hover fieldset": {
                    borderColor: "#FFA500",
                  },
                  "&.Mui-focused fieldset": {
                    borderColor: "#FFD700",
                  },
                },
              }}
            />
            <TextField
              label="Email Address"
              name="email"
              type="email"
              fullWidth
              required
              margin="normal"
              variant="outlined"
              onChange={(e) => setForm({ ...form, email: e.target.value })}
              InputLabelProps={{ style: { color: "#ccc" } }}
              InputProps={{
                style: { color: "#fff" },
              }}
              sx={{
                "& .MuiOutlinedInput-root": {
                  borderRadius: 2,
                  "& fieldset": {
                    borderColor: "#FFD700",
                  },
                  "&:hover fieldset": {
                    borderColor: "#FFA500",
                  },
                  "&.Mui-focused fieldset": {
                    borderColor: "#FFD700",
                  },
                },
              }}
            />
            <TextField
              label="Password"
              name="password"
              type="password"
              fullWidth
              required
              margin="normal"
              variant="outlined"
              onChange={(e) => setForm({ ...form, password: e.target.value })}
              InputLabelProps={{ style: { color: "#ccc" } }}
              InputProps={{
                style: { color: "#fff" },
              }}
              sx={{
                "& .MuiOutlinedInput-root": {
                  borderRadius: 2,
                  "& fieldset": {
                    borderColor: "#FFD700",
                  },
                  "&:hover fieldset": {
                    borderColor: "#FFA500",
                  },
                  "&.Mui-focused fieldset": {
                    borderColor: "#FFD700",
                  },
                },
              }}
            />

            <Button
              type="submit"
              fullWidth
              variant="contained"
              sx={{
                mt: 3,
                py: 1.3,
                fontSize: "1rem",
                fontWeight: 600,
                letterSpacing: "0.5px",
                borderRadius: 3,
                textTransform: "none",
                background:
                  "linear-gradient(90deg, #FFD700, #FFA500, #FF8C00)",
                boxShadow: "0 4px 15px rgba(255, 165, 0, 0.4)",
                "&:hover": {
                  background:
                    "linear-gradient(90deg, #FFC107, #FF9800, #FF6F00)",
                  boxShadow: "0 6px 18px rgba(255, 165, 0, 0.6)",
                  transform: "translateY(-2px)",
                  transition: "0.3s",
                },
              }}
            >
              Register
            </Button>
          </form>

          <Typography
            variant="body2"
            color="#bbb"
            mt={3}
            sx={{
              fontFamily: "Poppins, sans-serif",
            }}
          >
            Already have an account?{" "}
            <Box
              component="span"
              sx={{
                color: "#FFD700",
                fontWeight: 600,
                cursor: "pointer",
                "&:hover": { textDecoration: "underline" },
              }}
              onClick={() => navigate("/login")}
            >
              Login here
            </Box>
          </Typography>

          <Snackbar
            open={alert}
            autoHideDuration={2000}
            message="ðŸŽ‰ Registration successful!"
            onClose={() => setAlert(false)}
          />
        </Card>
      </Box>
    </Fade>
  );
}
